// import axios from "axios"

import { useEffect,useState } from "react"


const CurrencyRate = () => {

  const[Currency,setCurrency]=useState([]);
useEffect(()=>{
  fetch('http://127.0.0.1:8000/api/AllCurrency')
  .then((res)=>res.json())
  .then((data)=>data)


});

  return (


    <div>CurrencyRate</div>
  )
}

export default CurrencyRate
